import Profile from '../Images/profile.jpeg';

const Navbar = () => {
    return (
        <>
            <div className="profile">
                <img src={Profile} alt="profile" />
            </div>
            <div className="myName">
                <h2>Niket Kumar Mishra</h2>
            </div>
        </>
    );
}

export default Navbar;
